import { useFetch } from "./component/useFetch";


const App = () => {
 const {data} = useFetch(
  "https://api.themoviedb.org/3/movie/popular?api_key=b6247a3272129a1a56aa5b9fcd55bdc1"
  );

  return( 
  <div>
    <h1>hola peliculas</h1>
    <div>
     {  <ul>
        {data?.map.results((user) => (
          <li key={user.id}>{user.name}</li>
        ))}
      </ul> }

    </div>
    
    </div>);
}


export default App;
